"use strict";$(document).ready(function(){if(!usernameConfirm||!codeConfirm)return $("#confirmLoading").hide(),void $("#confirmFail").show();$.ajax({type:"POST",url:"/api/auth/register/confirm",data:{username:usernameConfirm,code:codeConfirm},cache:!1}).done(function(i){setTimeout(function(){$("#confirmLoading").hide(),i&&1==i.status?$("#confirmSuccess").show():$("#confirmFail").show()},1e3)}).fail(function(i,o){setTimeout(function(){$("#confirmLoading").hide(),$("#confirmFail").show()},1e3)})});